import React from 'react';

export default function CoordinateInput({ label, name, value, onChange, disabled }) {
  return (
    <label className="flex flex-col text-sm font-medium text-blue-200 space-y-1">
      {label}
      <input
        type="number"
        value={value}
        disabled={disabled}
        onChange={e => onChange(name, parseFloat(e.target.value))}
        className="bg-blue-900/50 border border-blue-300/30 rounded px-3 py-2 text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 disabled:opacity-50"
      />
    </label>
  );
}
